import React, { useState } from 'react';
import { useSpring, animated } from '@react-spring/web';
import './Login.css';

const Login = () => {
  const [isSignup, setIsSignup] = useState(false);

  // Animations for flex1 and flex2 sliding out
  const flexAnimation = useSpring({
    transform: isSignup ? 'translateX(-100%)' : 'translateX(0%)',
    opacity: isSignup ? 0 : 1,
  });

  // Background image animation
  const bgAnimation = useSpring({
    backgroundImage: isSignup
      ? 'url("/path-to-signup-bg.jpg")' // Change to signup background
      : 'url("/path-to-login-bg.jpg")', // Default login background
    config: { duration: 500 },
  });

  return (
    <animated.div className="main-content" style={bgAnimation}>
      <div className="flex-in-main">

        {/* Animated Flex1 */}
        <animated.div className="flex1" style={flexAnimation}>
          <animated.div className="line1"><h1>Welcome</h1></animated.div>
          <animated.div className="line2"><h1>To</h1></animated.div>
          <animated.div className="line3"><h1>BookShoppee</h1></animated.div>

          <div className="login-message">
            <div className='line4'><h1>Please</h1></div>
            <div className='line5'><h1>Login To</h1></div>
            <div className='line6'><h1>Proceed</h1></div>
          </div>
        </animated.div>

        {/* Animated Flex2 */}
        <animated.div className="flex2" style={flexAnimation}></animated.div>

        {/* Login / Signup Form */}
        <div className="flex3">
          {!isSignup ? (
            <div className="Login-content">
              <div className='uname'><label>Enter Username</label></div>
              <div className='enteruname'><input type="text" id="username" /></div>
              
              <div className='pass'><label>Enter Password</label></div>
              <div className='enterpass'><input type="password" id="password" /></div>

              <div className='login-button'><p>Login</p></div>
              
              <div className='createnewaccount' onClick={() => setIsSignup(true)}>
                <p>Create A New Account</p>
              </div>
            </div>
          ) : (
            <div className="Signup-content">
              <div className='uname'><label>Enter Name</label></div>
              <div className='enteruname'><input type="text" id="name" /></div>

              <div className='email'><label>Enter Email</label></div>
              <div className='enteremail'><input type="email" id="email" /></div>

              <div className='pass'><label>Enter Password</label></div>
              <div className='enterpass'><input type="password" id="password" /></div>

              <div className='signup-button'><p>Sign Up</p></div>

              <div className='back-to-login' onClick={() => setIsSignup(false)}>
                <p>Back to Login</p>
              </div>
            </div>
          )}
        </div>
      </div>
    </animated.div>
  );
};

export default Login;
